INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (259, 150, '10/03/13 -- 3:32 -- HA called Jasmine Moore (435-4352) to set up a time when she can come in regarding her new accident.  She will come in at 9:00 on 10/04/13 to sign paperwork.   ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (260, 151, '10/08/13 -- 8:40 -- HA called Jasmine Moore.  She does not have the managed care plan list.  Also, her car insurance is through Esurance. ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (261, 152, '10/08/13 -- 10:30 -- Jasmine Moore called and said that she got the list in the mail this morning.  She was looking on it and Dr. Bilkey is on it.  Can she go and see him.  HA told her that she thought that Dr. Bilkey was out of town.  She said that she will keep looking on her list.  She is going to bring HA a copy of her insurance card.   ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (262, 153, '10/08/13 -- 11:19 -- HA called Jamine Moore (435-4352) to let her know that EL wants a copy of the list immediately and that HA also needs a copy of her insurance card.  ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (263, 154, '10/08/13 -- 2:41 -- HA called Jamine Moore (435-4352) to give her Dr. Bilkeys cell number so she can make an appointment for today or tomorrow.  HA told her that she would need to stop by and pick up a Form 113 for Dr. Bilkey signed before she went to her appointment.  She said that she would.   ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (264, 155, '10/09/13 -- HA tired to order the Police Report but it is not on buycrash yet.  Ms. Moores DL # is M95105718 and the police department is Jefferson County Police Dept.   ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (265, 156, '010/09/13 -- 11:05 -- HA called Jamine Moore (435-4352) to make sure that she was able to get an appointment with Dr. Bilkey today.  She said that her appointment is at 1:00 and she is going to stop by about 20 till to get her Form 113 that Dr. Bilkey needs to sign.   ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (266, 157, 'On 10/15/13, MPG talked to Kelly of KORT - Goss Avenue (626-1200).  They do not give atty liens.  If they can get a written denial from WC, they will use health insurance and/or NF. ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (267, 158, '10/15/13 -- 11:23 -- Jessica of Esurance -- Regarding Jasmine Moore.  Received EL''s representation.  Do you have a copy of the policy report?  You can email it or fax it to me (Email:  jgilliam@esurance.com.  Fax:  800/334-9188).  Claim #ATL0105492.   ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (268, 159, '10/16/13 -- 2:25 -- Tony of Esurance -- (813/676-6478) Regarding Jasmine Moore.  PIP claim.  Please call with her injuries and what is her treatment status.  They have not received a NF app, only a letter of rep.  Claim No.: ALT0105492  Email: abenash@esurance.com   ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (269, 160, '10/17/13 -- 2:01 -- Jasmine Moore -- (435-4352) Someone from KORT called her and told her that even though we sent them a letter from Underwriters, it states that they are not paying because it is an out of network doctor.  They do not think that Humana will pay based on this because if she goes to an in network doctor and PT is prescribed, it will be paid by WC.  They will call Humana and find out if it will be approved and call us back.  Could call back tomorrow.   ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (270, 161, '10/21/13 -- 10:10 -- HA called Tony of Esurance (813-676-6478) to let him know that the NF application was enclosed with the letter of Rep.  He looked again and he does have the no fault application.    ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (271, 162, 'On 10/21/13, MPG talked to the receptionist of Dr. Russell May''s office (899-4177).  They do accept Wc patients, however, they need approval from the WC carrier before they will schedule an appt.  MPG would need to talk to their office manager, Lisa.  MPG left a message for Lisa to return the call.  ', NULL, NULL);
