INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (471, 363, '11/20/15 _ Brandie with Geico (478-744-5706) Rcf EL. Re: Jasmine Moore. EL had said willing to mediate or negotiate. They are standing on denial. If any additional information to review, but past that, standing beside the denial. Talked to jml, who said she would give EL the message. ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (472, 364, 'On 01/19/16, EL speaks with Amy Hockensmith of KY Retirement Systems (800/928-4646).  Is eliglble.  Need to fiund out when the last day of paid employment was.  She was injured on 01/20/14.  We can preserve by faxing it to them.  Need to complete the Form 6000, which is pages 1-9, but not pages 6&7 because she was discharged.  We can send other information later. ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (473, 365, '01/20/16 -- 1:50 -- Debbie of KY Retirement Systems -- (502/696-8513) Received an application for Jasmine Moore to apply for disability.  The application is filled out fine.  There is no age verification. They need a legible copy of her driver''s license (marriage certificate has to have her maiden name on it -- not a previous married name), Court Order, Passport, Immigration or Naturalization Document.  The best thing is a driver''s license.  This can be mailed or faxed.  They can go on with the application.  EL says her last contribution date is 01/20/14.  However, they show the last contribution for Jasmine Moore to KY Retirement System was 06/2014.  Debbie talked to her supervisor.  They need a copy of the driver''s license as quickly as possible.  The only thing she can tell us is that they will audit the file to see what the last date of employment is.  If for some reason they audit the file and the deadline is 01/20/16, because they do not have a complete and valid application, the claim will be denied.  As long as we get it faxed to them before midnight tonight (just in case 01/20/16 is the deadline), that would work. ', NULL, NULL);
INSERT INTO noteVersions (noteVersionsId, noteId, noteVersionsText, createdAt, updatedAt) VALUES (474, 366, 'On 01/20/16, MPG left a detailed message for Jasmine.  MPG said that if Jasmine cannot bring us her license to make a copy, maybe she can take a photo of the front/back and email it or text it or something.  MPG asked that Jasmine please give us a call.  Or we can email it to Debbie.hall@kyret.ky.gov before midnight tonight. ', NULL, NULL);
