CREATE TABLE clientMessageLists (
  clientMessageListId  integer NOT NULL PRIMARY KEY AUTOINCREMENT,
  clientId             integer NOT NULL,
  creatorUserId        integer NOT NULL,
  listName             varchar(100)
);

CREATE TABLE clientTableHold (
  clientId       integer NOT NULL PRIMARY KEY,
  clientName     varchar(255) DEFAULT NULL,
  clientAddress  varchar(255) DEFAULT NULL,
  clientCity     varchar(255),
  clientState    varchar(50) DEFAULT NULL,
  clientZip      varchar(10) DEFAULT NULL
);

CREATE TABLE clientTableHoldLamb (
  clientId       integer NOT NULL PRIMARY KEY,
  clientName     varchar(255) DEFAULT NULL,
  clientAddress  varchar(255) DEFAULT NULL,
  clientCity     varchar(255),
  clientState    varchar(50) DEFAULT NULL,
  clientZip      varchar(10) DEFAULT NULL
);

CREATE TABLE clientToNote (
  clientId        integer,
  noteId          integer,
  clientToNoteId  integer NOT NULL PRIMARY KEY AUTOINCREMENT,
  updatedAt       datetime,
  createdAt       datetime
);

CREATE TABLE clients (
  clientId                          integer NOT NULL PRIMARY KEY,
  clientName                        varchar(255) DEFAULT NULL,
  clientAddress                     varchar(255) DEFAULT NULL,
  clientCity                        varchar(255),
  clientState                       varchar(50) DEFAULT NULL,
  clientZip                         varchar(10) DEFAULT NULL,
  clientPhoneNotes                  text,
  clientEmailAddress                varchar(80),
  clientLiensNotes                  text,
  clientHealthInsuranceNotes        text,
  clientWorkersCompCarrierNotes     text,
  clientTypeOfCaseNotes             text,
  clientDOANotes                    text,
  clientLastPaymentDateNotes        text,
  client60LCodeNotes                text,
  clientCaseStyleAndAttorneysNotes  text,
  clientDisabilityInsuranceNotes    text,
  clientNoFaultCarrierNotes         text,
  clientFaultCarrierNotes           text,
  createdAt                         datetime,
  updatedAt                         datetime,
  clientDocumentationRoot           varchar(400)
);

CREATE TABLE listMembership (
  messageListId  integer,
  noteId         integer,
  /* Keys */
  CONSTRAINT listMembership_Index01
    PRIMARY KEY (messageListId, noteId)
);

CREATE TABLE noteVersions (
  noteVersionsId    integer NOT NULL PRIMARY KEY AUTOINCREMENT,
  noteId            integer,
  noteVersionsText  text,
  createdAt         datetime,
  updatedAt         datetime
);

CREATE TABLE notes (
  noteId              integer NOT NULL PRIMARY KEY AUTOINCREMENT,
  creatorId           integer NOT NULL,
  noteTypeId          integer DEFAULT 0,
  currentVersionId    integer,
  currentVersionText  text,
  createdAt           datetime,
  updatedAt           datetime
);

CREATE TABLE recentClientViews (
  recentClientViewsId  integer NOT NULL PRIMARY KEY,
  recentViewer         integer,
  recentViewee         integer,
  updatedAt            datetime,
  createdAt            datetime,
  /* Foreign keys */
  CONSTRAINT Foreign_key01
    FOREIGN KEY (recentViewee)
    REFERENCES clients(clientId)
);

CREATE UNIQUE INDEX recentClientViews_Index01
  ON recentClientViews
  (recentViewer, recentViewee);

CREATE TABLE taskList (
  taskListId    integer NOT NULL PRIMARY KEY,
  ownerId       integer,
  taskListText  varchar(100)
);

CREATE TABLE tokens (
  id         integer PRIMARY KEY,
  tokenHash  varchar(255),
  createdAt  datetime NOT NULL,
  updatedAt  datetime NOT NULL
);

CREATE TABLE userMessageLists (
  userMessageListId  integer NOT NULL PRIMARY KEY AUTOINCREMENT,
  ownerUserId        integer NOT NULL,
  creatorUserId      integer NOT NULL,
  listName           varchar(100)
);

CREATE TABLE userTable (
  userId        integer NOT NULL PRIMARY KEY AUTOINCREMENT,
  userName      varchar(50) NOT NULL,
  userPassword  varchar(50) NOT NULL,
  firstName     varchar(50) NOT NULL,
  lastName      varchar(50) NOT NULL,
  lastLogin     datetime
);

CREATE TABLE users (
  userId         integer PRIMARY KEY,
  email          varchar(50) NOT NULL,
  firstName      varchar(50),
  lastName       varchar(50),
  lastLogin      datetime,
  createdAt      datetime NOT NULL,
  updatedAt      datetime NOT NULL,
  password_hash  varchar(50),
  salt           varchar(50),
  /* Keys */
  UNIQUE (email)
);

